      subtitleItem: 'Ультразвуковая система',
      itemDesc: "Современные технологии выводят портативные ультразвуковые системы на новый уровень качества изображений, поэтому можно не жертвовать качеством ради портативности. Система соответствует требованиям к отделениям интенсивной терапии и обладает производительностью стационарных систем там, где это необходимо.",
      oss: [{
        img: '',
        title: 'Технология PureWave там, где это необходимо',
        text: 'Технология PureWave стала самым большим прорывом в создании пьезоэлектрических датчиков за последние 40 лет. Чистые, однородные кристаллы PureWave на 85% эффективнее обычных пьезоэлектрических материалов и благодаря этому обладают уникальными рабочими характеристиками. Эта технология обеспечивает повышенную глубину проникновения при исследовании пациентов с плохим ультразвуковым окном и позволяет достичь превосходного пространственного разрешения.'
      }, {
        img: '',
        title: 'Расширенная диагностическая информация',
        text: 'Система CX50 позволяет проводить оценку и количественный анализ с помощью модулей приложения QLAB: GI 3D quantification (GI 3DQ) (Модуль количественного анализа 3D-исследований), Region of interest (ROI) (Количественный анализ области интереса), Intima media thickness evaluation (IMT) (Оценка толщины комплекса интима-медиа), Cardiac motion quantification with speckle tracking technology (CMQ) (Количественный анализ движений сердца на основе отслеживания спекл-шума), Strain quantification (SQ) (Количественный анализ деформации миокарда) и MicroVascular imaging (MVI) (Визуализация микрососудов)'
      }, {
        img: '',
        title: 'Портативная ультразвуковая система — доступна там, где требуются экстренные действия',
        text: 'Получение диагностических данных с помощью портативных систем осложняется рядом факторов. Теперь вы можете формировать изображения необходимого качества и уверенно ставить диагноз там, где это необходимо. Возьмите систему CX50 к своим пациентам — в хирургическое отделение, отделение реанимации или интенсивной терапии, в клинику-филиал, на место проведения выездных скрининговых исследований, в операционную и отделение неотложной помощи или в ОРИТ новорожденных и детские ОРИТ. Благодаря качеству изображений система CX50 является идеальным выбором для тяжело больных пациентов, там где ограниченное пространство и оборудование затрудняют доступ к пациенту и там, где требуются быстрые действия.'
      }, {
        img: '',
        title: 'Широкополосная цифровая технология формирования луча на портативной ультразвуковой системе',
        text: 'Система CX50 сочетает в себе широкополосную цифровую технологию формирования луча с возможностью генерации широкополосных сигналов с помощью датчиков PureWave. Теперь вы можете даже с помощью портативной системы получить, сохранить и вывести на экран полную информацию об исследуемой ткани. При этом высочайший уровень качества изображений позволит вам без труда рассмотреть даже мельчайшие анатомические детали.'
      }]
